def solve(lst, n):
    max_val = lst[0][n-1]
    for tup in lst:
        if tup[n-1] > max_val:
            max_val = tup[n-1]
    return max_val

def solve(tuples, n):
    max_value = tuples[0][n]
    for i in range(1, len(tuples)):
        if tuples[i][n] > max_value:
            max_value = tuples[i][n]
    return max_value

